// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "./MediaLibrary.sol";
import "./MediaFractionalizeManager.sol";
import "./PriviNFT.sol";

contract MediaUpdateManager is AccessControl {
    using Counters for Counters.Counter;
    using MediaLibrary for Media;

    Counters.Counter private _updateProposalIds;

    uint64 public constant UPDATE_MEDIA_PROPOSAL_DURATION = 1 weeks;

    bytes32 public constant ADMIN = keccak256("admin");
    // this is the role for the media manager contract
    bytes32 public constant MEDIA_ADMIN = keccak256("media_admin");

    address public immutable priviNFTContractAddress;
    address public immutable mediaFractionalizeManagerAddress;

    PriviNFT private immutable _priviNFT;
    MediaFractionalizeManager private immutable _mediaFractionalizeManager;

    // map from id to updateProposals
    mapping(uint256 => UpdateMediaProposal) private _updateMediaProposals;
    // stores a mapping of collabs and if already voted by proposalId
    mapping(uint256 => mapping(address => bool)) private _updateMediaProposalsVoted;

    event CreateUpdateMediaProposal(address indexed from, uint256 indexed mediaId, uint256 proposalId);
    event AcceptUpdateMediaProposal(uint256 indexed mediaId, uint256 proposalId);
    event DenyUpdateMediaProposal(uint256 indexed mediaId, uint256 proposalId);
    event VoteUpdateMediaProposal(address indexed from, uint256 indexed mediaId, uint256 proposalId);
    event ExpireUpdateMediaProposal(uint256 indexed mediaId, uint256 proposalId);

    constructor(address _priviNFTContractAddress, address _mediaFractionalizeManagerAddress) {
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(ADMIN, msg.sender);
        priviNFTContractAddress = _priviNFTContractAddress;
        mediaFractionalizeManagerAddress = _mediaFractionalizeManagerAddress;
        _mediaFractionalizeManager = MediaFractionalizeManager(_mediaFractionalizeManagerAddress);
        _priviNFT = PriviNFT(_priviNFTContractAddress);
    }

    // allow collabs to propose updates for medias
    function createUpdateMediaProposal(UpdateMediaRequest memory _updateMediaRequest) external {
        require(_updateMediaRequest.requesterAddress == msg.sender, "Address signature is not valid");

        _updateProposalIds.increment();

        uint256 proposalId = _updateProposalIds.current();

        Media memory media = _priviNFT.getMedia(_updateMediaRequest.mediaId);

        int256 index = _mediaFractionalizeManager.getOwnerIndex(msg.sender, _updateMediaRequest.mediaId);
        require(index >= 0, "Requester is not an owner of this media");

        address[] memory ownersAddresses = _mediaFractionalizeManager.getOwnersAddresses(
            _updateMediaRequest.mediaId
        );

        UpdateMediaProposal memory _updateMediaProposal = UpdateMediaProposal({
            minApprovals: uint64(media.ownersSize),
            maxDenials: 1,
            duration: UPDATE_MEDIA_PROPOSAL_DURATION,
            date: uint64(block.timestamp), // solhint-disable-line
            positiveVotesCount: 0,
            negativeVotesCount: 0,
            community: ownersAddresses,
            request: _updateMediaRequest
        });

        // save the proposal for voting
        _updateMediaProposals[proposalId] = _updateMediaProposal;

        emit CreateUpdateMediaProposal(msg.sender, _updateMediaRequest.mediaId, proposalId);
    }

    // proposal struct getter by id
    function getUpdateMediaProposal(uint256 _proposalId)
        external
        view
        onlyRole(ADMIN)
        returns (UpdateMediaProposal memory)
    {
        UpdateMediaProposal memory updateMediaProposal = _updateMediaProposals[_proposalId];
        require(updateMediaProposal.minApprovals != 0, "Query for unexistent update proposal");
        return updateMediaProposal;
    }

    // allow collabs to vote updates proposals for medias
    function voteMediaUpdateProposal(uint256 _proposalId, bool _vote) external {
        require(_updateMediaProposals[_proposalId].minApprovals != 0, "Voting unexistent update proposal");

        UpdateMediaProposal memory updateMediaProposal = _updateMediaProposals[_proposalId];

        bool isInCommunity;
        for (uint256 i; i < updateMediaProposal.community.length; i++) {
            if (updateMediaProposal.community[i] == msg.sender) {
                isInCommunity = true;
                break;
            }
        }

        require(isInCommunity, "The voter is not in the community");
        require(!_updateMediaProposalsVoted[_proposalId][msg.sender], "ShareHolder already voted");

        _updateMediaProposalsVoted[_proposalId][msg.sender] = true;

        // check if expired
        // solhint-disable-next-line
        if (updateMediaProposal.date + updateMediaProposal.duration < block.timestamp) {
            // delete the recover gas
            delete _updateMediaProposals[_proposalId];
            emit ExpireUpdateMediaProposal(updateMediaProposal.request.mediaId, _proposalId);
        } else {
            // if the vote is positive
            if (_vote) {
                // if is the last vote to approve
                if (updateMediaProposal.positiveVotesCount + 1 == updateMediaProposal.minApprovals) {
                    // update the media and delete the proposal
                    _priviNFT.updateMedia(updateMediaProposal.request);
                    delete _updateMediaProposals[_proposalId];

                    emit AcceptUpdateMediaProposal(updateMediaProposal.request.mediaId, _proposalId);
                } else {
                    // update the proposal and emit the event
                    _updateMediaProposals[_proposalId].positiveVotesCount++;
                    emit VoteUpdateMediaProposal(
                        msg.sender,
                        updateMediaProposal.request.mediaId,
                        _proposalId
                    );
                }
            }
            // if the vote is negative
            else {
                // if is the last vote to deny
                if (updateMediaProposal.negativeVotesCount + 1 == updateMediaProposal.maxDenials) {
                    // delete the proposal and emit the event
                    delete _updateMediaProposals[_proposalId];

                    emit DenyUpdateMediaProposal(updateMediaProposal.request.mediaId, _proposalId);
                } else {
                    // update the proposal and emit the event
                    _updateMediaProposals[_proposalId].negativeVotesCount++;
                    emit VoteUpdateMediaProposal(
                        msg.sender,
                        updateMediaProposal.request.mediaId,
                        _proposalId
                    );
                }
            }
        }
    }
